import React, {useState} from 'react';
import './App.css';

function App() {
  const [number, setNumber] = useState(0);
  console.log(number);
return (
    <div className="App">
      <div>{number}</div>
      <button
        onClick={() => setNumber(number +1)}
      >
      +
      </button>
      <button
        onClick={() => setNumber()}
      >
      -
      </button>
    </div>
  );
}

export default App;
